import React from 'react';
import Link from 'next/link';
import Router from 'next/router';

const ErrorPage = () => (
  <div>
    <h1>Oops, something went wrong.</h1>
    <p>
      Try
      <Link href='/auth'>
        <a>going back</a>
      </Link>
    </p>
    <button onClick={() => Router.push('/auth')}>Go to Auth</button>
  </div>
);

export default ErrorPage;
